
window.addEventListener("load", function () {

    images = {

        "bug": "",

        "dark":
            "",
        "dragon":
            "",
        "electric":
            "",
        "fairy":
            "",
        "fighting":
            "",
        "fire":
            "",
        "flying":
            "",
        "ghost":
            "",
        "grass":
            "",
        "ground":
            "",
        "ice":
            "",
        "normal":
            "",
        "poison":
            "",
        "psychic":
            "",
        "rock":
            "",
        "steel":
            "",
        "water":
            ""
    };
    cMap = {
        "ARI": "FLYING",
        "OAK": "FIGHTING",
        "ATL": "DARK",
        "BAL": "DARK",
        "BUF": "GRASS",
        "CAR": "POISON",
        "CHI": "FAIRY",
        "CIN": "FIRE",
        "CLE": "PSYCHIC",
        "DAL": "FAIRY",
        "DEN": "GROUND",
        "DET": "BUG",
        "GBP": "ICE",
        "HOU": "FIRE",
        "IND": "GROUND",
        "JAC": "POISON",
        "KCC": "GHOST",
        "LAC": "ELECTRIC",
        "LAR": "ROCK",
        "MIA": "WATER",
        "MIN": "ICE",
        "NEP": "NORMAL",
        "NOS": "PSYCHIC",
        "NYG": "DRAGON",
        "NYJ": "STEEL",
        "LVR": "FIGHT",
        "PHI": "FLYING",
        "PIT": "STEEL",
        "SEA": "WATER",
        "SFO": "ROCK",
        "TBB": "FIGHTING",
        "TEN": "ELECTRIC",
        "WAS": "GHOST"
    };
    tips = {
        "bug": "",
        "dark": "",
        "dragon": "",
        "electric": "",
        "fairy": "",
        "fighting": "",
        "fire": "",
        "flying": "",
        "ghost": "",
        "grass": "",
        "ground": "",
        "ice": "",
        "normal": "",
        "poison": "",
        "psychic": "",
        "rock": "",
        "steel": "",
        "water": ""
    }

    if (!document.getElementById('club-tips')) {
        let tips = $('body').append('<div id="club-tips"> </div>');
        $('#club-tips').css({
            "background": "transparent",
            "width": "150px",
            "height": "60px",
            "text-align": "center",
            "border-radius": "2px",
            "padding": "8px",
            "pointer-events": "none",
            "font": "sans-serif",
            "font-size": "11px",
            "opacity": 0.9,
            "position": "absolute",
            "visibility": "hidden",
            "transform": "translate(-30%, -175%) scale(1)"
        });

    }

    $('.player>a, .player>span>a, td>a.position_qb, td>a.position_rb, td>a.position_wr, td>a.position_te').each((_, item) => {
        item = $(item);
        let content = item.html().split(' ');
        let club = content[content.length - 2];
        if (cMap[club] && !item.parent().html().includes(`${club}-tips`)) {
            let image = images[cMap[club].toLowerCase()];
            let imageHTML = $(`<div class="${club}-tips" style="display:inline-block;" > <img  style="margin-left:4px; margin-top:4px" src="data:image/png;base64, ${image}" /></div>`);
            item.parent().append(imageHTML);
            $(`.${club}-tips`).on('mouseover', function (event) {
                $('#club-tips').css({
                    "visibility": "visible",
                    "top": `${event.pageY + 10}px`,
                    'left': `${event.pageX}px`
                }).html(`<img  style="margin-left:4px; margin-top:4px" src="data:image/png;base64, ${tips[cMap[club].toLowerCase()]}"/>`)
            }).on('click', function (event) {
                $('#club-tips').css({
                    "visibility": "visible",
                    "top": `${event.pageY}px`,
                    'left': `${event.pageX}px`
                }).html(`<img  style="margin-left:4px; margin-top:4px" src="data:image/png;base64, ${tips[cMap[club].toLowerCase()]}"/>`)
            }).on("mousemove", function () {
                $('#club-tips').css({
                    "visibility": "visible",
                    "top": `${event.pageY}px`,
                    'left': `${event.pageX}px`
                })
            })

                .on("mouseout", function () {
                    $('#club-tips').css({
                        "visibility": "hidden"
                    })
                })
        } else {
            console.log("Image for club not found : ", club)
        }
    })

});
